import './global.css'
import { BrowserRouter, Routes, Route } from 'react-router-dom'

import Dashboard from './Pages/Dashboard.js'

function App() {  

  const ThemeContext = React.createContext('light');

  return (
    <div>
        <BrowserRouter>
          <Routes>
            <Route path='' element={ <Dashboard /> } />
          </Routes>
        </BrowserRouter>
    </div>
  )
}

export default App
